import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div id="root" className="container">
        <section class="movie-app">
        <main><ul class="all-movies"></ul></main>
        </section>
    </div>
    );
  }
}

export default App;
